Familie / Komedie
90 minuten
geregisseerd door Michael Lembeck
met Ashley Tisdale, Bradley Steven Perry en Austin Butler

Sharpay Evans krijgt te horen dat ze auditie mag doen voor een musical op Broadway. Ze reist af naar New York samen met haar hondje. Eenmaal aangekomen 

blijkt dat de auditie voor haar hond is, en niet voor Sharpay zelf. Zal haar droom in duigen vallen, of zal dit het begin zijn van een nieuw avontuur?
